import { Route, Routes } from "react-router-dom";
import routesFrontendRoutes from "../../shared/routes/routesFrontend.routes";
import { IndexPerson } from "../components";

export const RouterPerson = () => {
  return (
    <Routes>
      <Route path={routesFrontendRoutes.module}>
        <Route
          path={routesFrontendRoutes.person}
          element={<IndexPerson />}
        ></Route>
      </Route>
    </Routes>
  );
};
